// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.9;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "@openzeppelin/contracts/token/ERC721/utils/ERC721Holder.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

contract GroovesAuction is ERC721Holder {
    using SafeMath for uint256;

    struct Bid {
        address payable bidder;
        uint256 amount;
    }

    struct AuctionData {
        address seller;
        uint256 tokenId;
        uint256 startPrice;
        uint256 endPrice;
        uint256 duration;
        uint256 startTime;
        bool active;
        Bid highestBid;
    }

    mapping(uint256 => AuctionData) public auctions;

    event AuctionCreated(
        address seller,
        uint256 tokenId,
        uint256 startPrice,
        uint256 endPrice,
        uint256 duration
    );
    event AuctionEnded(address winner, uint256 tokenId, uint256 amount);

    function createAuction(
        uint256 tokenId,
        uint256 startPrice,
        uint256 endPrice,
        uint256 duration
    ) external {
        require(
            IERC721(msg.sender).ownerOf(tokenId) == msg.sender,
            "Only the owner can create an auction"
        );
        require(startPrice > 0, "Start price must be greater than 0");
        require(endPrice > 0, "End price must be greater than 0");
        require(duration > 0, "Duration must be greater than 0");

        IERC721(msg.sender).safeTransferFrom(
            msg.sender,
            address(this),
            tokenId
        );

        auctions[tokenId] = AuctionData({
            seller: msg.sender,
            tokenId: tokenId,
            startPrice: startPrice,
            endPrice: endPrice,
            duration: duration,
            startTime: block.timestamp,
            active: true,
            highestBid: Bid({bidder: payable(address(0)), amount: 0})
        });

        emit AuctionCreated(
            msg.sender,
            tokenId,
            startPrice,
            endPrice,
            duration
        );
    }

    function placeBid(uint256 tokenId) external payable {
        AuctionData storage auction = auctions[tokenId];
        require(auction.active, "Auction is not active");
        require(
            msg.value > auction.highestBid.amount,
            "Bid amount must be greater than highest bid"
        );
        require(
            block.timestamp < auction.startTime + auction.duration,
            "Auction has ended"
        );

        if (auction.highestBid.amount > 0) {
            auction.highestBid.bidder.transfer(auction.highestBid.amount);
        }

        auction.highestBid = Bid({
            bidder: payable(msg.sender),
            amount: msg.value
        });
    }

    function endAuction(uint256 tokenId) external {
        AuctionData storage auction = auctions[tokenId];
        require(auction.active, "Auction is not active");
        require(
            block.timestamp >= auction.startTime + auction.duration,
            "Auction has not ended yet"
        );

        address winner = auction.highestBid.bidder;
        uint256 amount = auction.highestBid.amount;

        if (amount < auction.endPrice) {
            amount = auction.endPrice;
        }

        IERC721(msg.sender).safeTransferFrom(address(this), winner, tokenId);
        

        auction.active = false;

        emit AuctionEnded(winner, tokenId, amount);
    }
}

